import React from 'react';
import Navbar from './Navbar';
import Card from './Card';


const Service = () => {
    return (
        <>
            <Navbar />

            <div className='container'>
            <div className='wrapper'>

                <Card 
                    imgsrc='./images/1.jpg'
                    title='Web Development'
                    desc='Lorem ipsum dolor sit amet consectetur adipisicing elit. Explicabo quia aliquid, maiores nostrum excepturi.'
                />

            </div>


            </div>
        </>
    )
}
export default Service;
